// icons
import 'bootstrap-icons/font/bootstrap-icons.css';
import 'remixicon/fonts/remixicon.css';

//import bootstrap
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.min.js';

import React from 'react'
import './App.css';
import Header from './pages/global/Header/Header';
import SideBar from './pages/global/SideBar/SideBar';
import { useTheme } from './context/ThemeContext';
import DashboardTBNotif from './pages/Dashboard_TB/Dashboard_TB_Notif';
import DashboardTBObit from './pages/Dashboard_TB/Dashboard_TB_Obt';
import DashboardTBAbam from './pages/Dashboard_TB/Dashboard_TB_Abam';
import DashboardTBHIVNotif from './pages/Dashboard_TB_HIV/Dashboard_TB_HIV_Notif';
import DashboardTBHIVObit from './pages/Dashboard_TB_HIV/Dashboard_TB_HIV_Obt';
import DashboardTBHIVAbam from './pages/Dashboard_TB_HIV/Dashboard_TB_HIV_Abam';

import Home from './pages/Home/Home';
import MapsNotif from './pages/Maps/MapsNotif';
import MapsObit from './pages/Maps/MapsObit';
import MapsAbam from './pages/Maps/MapsAbam';
import { Routes, Route } from 'react-router-dom';

function App() {

  const {theme} = useTheme();

  return (
      <div className="App" id={theme}>
        <Header />
        <SideBar />
        <main id="main" className="main p-3">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/TB-notificacao" element={<DashboardTBNotif />} />
            <Route path="/TB-obito" element={<DashboardTBObit />} />
            <Route path="/TB-abandono" element={<DashboardTBAbam />} />

            <Route path="/HIV-notificacao" element={<DashboardTBHIVNotif />} />
            <Route path="/HIV-obito" element={<DashboardTBHIVObit />} />
            <Route path="/HIV-abandono" element={<DashboardTBHIVAbam />} />

            <Route path="/Maps-notificacao" element={<MapsNotif />} />
            <Route path="/Maps-obito" element={<MapsObit />} />
            <Route path="/Maps-abandono" element={<MapsAbam />} />

            <Route path="/Pred-notificacao" element={<Home />} />
            <Route path="/Pred-obito" element={<Home />} />
            <Route path="/Pred-abandono" element={<Home />} />
          </Routes>
        </main>
      </div>
  );
}

export default App;
